package week1.day1.HomeAssignments;

public class SwapNumbers {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int inpNum1 = 10;
		int inpNum2 = 20;
		
		System.out.println("Before Swapping:"+inpNum1+"  "+inpNum2);
		
		int temp;
		temp = inpNum1;
		inpNum1 = inpNum2;
		inpNum2 = temp;
		
		System.out.println("After Swapping:"+inpNum1+"  "+inpNum2);
		

	}
	

}
